import React from 'react';

const Buscador = () => {
    return (  
        <div className="container">
        <div className="row">
          <form className="form">
            <div className="input-group">
              <input className="form-control" type="text" placeholder="Search" aria-label="Search" style={{paddingLeft: '20px', borderRadius: '40px'}} id="mysearch" />
              <div className="input-group-addon" style={{marginLeft: '-50px', zIndex: 3, borderRadius: '40px', backgroundColor: 'transparent', border: 'none'}}>
                <button className="btn btn-warning btn-sm" type="submit" style={{borderRadius: '20px'}} id="search-btn"><i className="fa fa-search" /></button>
              </div>
            </div>
          </form>
        </div>
      </div>
    );
}
 
export default Buscador;
